import React from 'react';

function Botton() {
  const [contador, setContador] = React.useState(0);

  return (
    <>
      <button
        onClick={() => {
          setContador(contador + 1);
        }}
      >
        {contador}
      </button>
    </>
  );
}

export default Botton;
